import React, { useState } from 'react';
import { Table, Button, Modal, ModalHeader, ModalBody, ModalFooter } from 'reactstrap';
import variables from './../variables';

function Verification({ students, setStudents }) {
 const [selectedStudent, setSelectedStudent] = useState(null);
 const [modal, setModal] = useState(false);

 const toggle = () => setModal(!modal);

 const handleConfirm = (studentId) => {
    // Send a request to the server to confirm the student
    fetch(variables.API_URL + 'user/' + studentId, {
      method: 'PATCH',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify({ verified: true })
    })
      .then(response => response.json())
      .then(data => {
        // Show a modal
        window.alert("Verification completed successfully");

        // Remove the confirmed student from the list
        setStudents(students.filter(student => student.id !== studentId));

        // Close the modal
        toggle();

        // Reload the page
        window.location.reload();
      })
      .catch(error => {
        console.error('Failed to confirm student:', error);
      });
 };

 const handleDelete = (studentId) => {
    // Send a request to the server to delete the student
    fetch(variables.API_URL + 'user/' + studentId, {
      method: 'DELETE'
    })
      .then(response => {
        // Remove the deleted student from the list
        setStudents(students.filter(student => student.id !== studentId));

        // Close the modal
        toggle();
      })
      .catch(error => {
        console.error('Failed to delete student:', error);
      });
 };

 const handleSeeDetails = (student) => {
    setSelectedStudent(student);
    toggle();
 };

 return (
    <div style={{ margin: '20px', padding: '20px' }}>
      <Table striped style={{ marginTop: '20px' }}>
        <thead>
          <tr>
            <th>#</th>
            <th>ID</th>
            <th>Name</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {students.map((student, index) => (
            <tr key={student.id}>
              <td>{index + 1}</td>
              <td>{student.id}</td>
              <td>{student.first_name} {student.last_name}</td>
              <td>
                <Button color="primary" onClick={() => handleSeeDetails(student)}>See Details</Button>
              </td>
            </tr>
          ))}
        </tbody>
      </Table>

      <Modal isOpen={modal} toggle={toggle}>
        <ModalHeader toggle={toggle}>Student Details</ModalHeader>
        <ModalBody>{selectedStudent && (
            <Form>
              <FormGroup>
                <Label>ID:</Label>
                <p>{selectedStudent.id}</p>
              </FormGroup>
              <FormGroup>
                <Label>Last Name:</Label>
                <p>{selectedStudent.last_name}</p>
              </FormGroup>
              <FormGroup>
                <Label>Email:</Label>
                <p>{selectedStudent.email}</p>
              </FormGroup>
              <FormGroup>
                <Label>Gender:</Label>
                <p>{selectedStudent.gender}</p>
              </FormGroup>
              <FormGroup>
                <Label>Department:</Label>
                <p>{selectedStudent.department}</p>
              </FormGroup>
              <FormGroup>
                <Label>Phone No.:</Label>
                <p>{selectedStudent.phone}</p>
              </FormGroup>
              <FormGroup>
                <Label>Permanent Address:</Label>
                <p>{selectedStudent.permanent_address}</p>
              </FormGroup>
              <FormGroup>
                <Label>Hall Name:</Label>
                <p>{selectedStudent.hall_name}</p>
              </FormGroup>
              <FormGroup>
                <Label>Room No.:</Label>
                <p>{selectedStudent.room_no}</p>
              </FormGroup>
              <FormGroup>
                <Label>Image:</Label>
                <p>Image: <img src={`https://res.cloudinary.com/your-cloud-name/${selectedStudent.image}`} alt="Student" /></p>
              </FormGroup>
              <FormGroup>
                <Label>Blood Group:</Label>
                <p>{selectedStudent.blood_group}</p>
              </FormGroup>
              <FormGroup>
                <Label>Transaction ID:</Label>
                <p>{selectedStudent.transaction_id}</p>
              </FormGroup>
              <FormGroup>
                <Label>Created At:</Label>
                <p>{selectedStudent.created_at}</p>
              </FormGroup>
              <FormGroup>
                <Label>Is_Staff:</Label>
                <p> {selectedStudent.is_staff ? 'Yes' : 'No'}</p>
              </FormGroup>
              <FormGroup>
                <Label>Is_Superuser:</Label>
                <p>{selectedStudent.is_superuser ? 'Yes' : 'No'}</p>
              </FormGroup>
              <FormGroup>
                <Label>Is_Active:</Label>
                <p>{selectedStudent.is_active ? 'Yes' : 'No'}</p>
              </FormGroup>
              </Form>
          )}
        </ModalBody>
        <ModalFooter>
          <Button color="success" onClick={() => handleConfirm(selectedStudent.id)}>Confirm</Button>{' '}
          <Button color="danger" onClick={() => handleDelete(selectedStudent.id)}>Delete</Button>{' '}
          <Button color="secondary" onClick={toggle}>Cancel</Button>
        </ModalFooter>
      </Modal>
    </div>
 );
}

export default Verification;
